import React from "react";
import { Link } from "react-router-dom";
//import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
//import { faBars, faMagnifyingGlass, faAngleDown, faCartShopping } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHouse } from '@awesome.me/kit-KIT_CODE/icons/classic/solid'

const element = <FontAwesomeIcon icon={faHouse} />

export default function Footer() {
    return(
        <footer>
            <div>
                <Link className="BLACKOUT" to="/">tyra woden</Link>
            </div>
            <div>
                <ul>
                    <li><Link to="https://www.linkedin.com/in/tyra-wod%C3%A9n-3b036526b/" target="_blank" rel="noopener noreferrer">LinkedIn</Link></li>
                    <li><Link to="https://github.com/k4tttt" target="_blank" rel="noopener noreferrer">GitHub</Link></li>
                    <li><Link to="mailto: tyra.woden@gmail.com"><FontAwesomeIcon icon={faHouse} />tyra.woden@gmail.com</Link></li>
                </ul>
            </div>
        </footer>
    )
}
